### JavaScript

```javascript
"use strict";

function largestPalindrome(n) {
    let mx = Math.pow(10, n) - 1;
    for (let a = mx; a > mx / 10; a--) {
        let b = x = a;
        while (b) {
            x = x * 10 + b % 10;
            b = Math.floor(b / 10);
        }
        let t = mx;
        while (t * t >= x) {
            if (x % t === 0) {
                return x % 1337;
            }
            t--;
        }
    }
    return 9;
}
